import React from 'react';
import {Link} from 'react-router-dom';

function NavBar(){
    return(
        <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/books">Books</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/media">Media</Link></li>
        </ul>
    )
}

export default NavBar;
